# Проверка то, что файл существует и имеет расширение .bsp
def testbspfile(file):
    if not os.path.isfile(file):
        print("Error! File not found")
        input()
        sys.exit()
    if os.path.splitext(file)[1] != ".bsp":
        print("Error! File extension is not bsp: " + file)
        input()
        sys.exit()

def createfile(path, lines):
    with open(path, "w", encoding='utf-8') as file:
        for  line in lines:
            file.write(line + '\n')
    file.close()

# Создания дефолтного конфига
def create_config(path):
    print ('Create config file.')
    lines = ['# Список со стандартными файлами, которые не будут учитываться', 'backlistres = backlistres.txt', '# Копировать ли карту с файлами', 'copymode = 1', '# Куда копировать карту', 'copydir = .\\maps', '# Копировать ли карту, если есть ошибки (0 - копировать, 1 - выводить ошибку, с возможностью копирования 2 - не копировать)', 'copyiferrors = 1', '# Создовать ли res файл (если copymode=1, создает в copydir, если 0 - в папке с картой)', 'genresfile = 1', '# Показывать ли res файл', 'showresfie = 1', '# Проверять ли наличие файлов по res списку (автоматически работает при copymode=1)', 'testfilelist = 1']
    createfile(path,lines)

# Чтение конфига
def read_config(path, parm):
    #Открываем файл
    file = open(path, "r", encoding='utf-8')
    #Перебираем значения
    findcvars = False
    for i in file.read().splitlines():
        if i.startswith(parm):
            cvar = i.lstrip(parm).lstrip().lstrip('=').lstrip() #Удаляем название квара, пробел, знак равно, пробел
            findcvars = True
    if not findcvars:
        create_config(path)
        print('Config file parameters error, default config creation. Restart required. Press any button to exit.')
        input()
        sys.exit()
    # закрываем файл
    file.close()
    return cvar

# Добовляет в список необходимых файлов
def addres(x, reslist):
    if x not in reslist:
        if x:
            reslist.append(x)
# Вносит в список необходимых файлов файлы скайбокса 
def addres_skybox(x, reslist):
    addres("gfx/env/"+x+"bk.tga", reslist)
    addres("gfx/env/"+x+"dn.tga", reslist)
    addres("gfx/env/"+x+"ft.tga", reslist)
    addres("gfx/env/"+x+"lf.tga", reslist)
    addres("gfx/env/"+x+"rt.tga", reslist)
    addres("gfx/env/"+x+"up.tga", reslist)
#Проверка Ентити
def checkEntity(x, i, nowarn=False):
    if x in i:
        return True
    else:
        if not nowarn == True:
            if 'origin' in i:
                errorslog.append("Warning! Empty " + x + " on " + i['classname'] +" entity (" + i['origin'] +")")
            else:
                errorslog.append("Warning! Empty " + x + " on " + i['classname'] +" entity")
        return False

# Создание списка res файла
def genres(file):
    reslist = []
    #Открываем bsp
    filelist = open(file, 'rb')
    bspfile = filelist.read()
    filelist.close()
    
    version = struct.unpack_from('i', bspfile, 0)[0]

    if version != 30:
        decrypted = []
        for byte in bspfile:
            decrypted.append(byte ^ 0xC0)
        bspfile = decrypted
    if version != 30:
        sys.exit(0)

    offset = struct.unpack_from('i', bspfile, 4)[0]
    dataLength = struct.unpack_from('i', bspfile, 8)[0]
    data = bspfile[offset:offset+dataLength]
    data = data.decode('utf-8')

    #Преобразуем в список json
    data = '['+data.replace('" "','":"').replace('"\n', '",\n').replace('}\n{', '},\n{').replace('\x00', '').replace('",\n}', '"\n}').replace('wad":"', 'wad":'+'["').replace('.wad;"', '.wad"]').replace(';', '","').replace('\\', '/')+']'
    
    data = json.loads(data)
    
    for i in data:
        # Список wad файлов и skybox 
        if (i['classname'] == 'worldspawn'):
            if checkEntity('wad', i, True):
                for x in i['wad']:
                    if x != os.path.basename(x):
                        errorslog.append("Warning! WAD file has a non-standard location: " + x)
                    addres(os.path.basename(x), reslist)
            if checkEntity('skyname', i):
                addres_skybox(i['skyname'], reslist)
        # Модели и спрайты
        if (i['classname'] == 'cycler') | (i['classname'] == 'cycler_sprite') | (i['classname'] == 'env_sprite') | (i['classname'] == 'env_glow')  | (i['classname'] == 'cycler_wreckage'):
            if checkEntity('model', i):
                addres(i['model'], reslist)
        # Звуки
        if (i['classname'] == 'ambient_generic'):
            if checkEntity('message', i):
                addres("sound/"+i['message'], reslist)
        # Другое, ссылки на модель которых не обезательна
        if (i['classname'] == 'hostage_entity') | (i['classname'] == 'info_player_deathmatch') :
            if checkEntity('model', i, True):
                addres(i['model'], reslist)

    return reslist
# Проверяет res файл на наличие заглавных букв
def checkres(res):
    errors= []
    for x in res:
        if not x.islower():
            errors.append('Warning! File uppercase on name: ' + x)
        if ' ' in x:
            errors.append('Error! File spaсe on name: ' + x)
    return errors
# Проверяет файлы в каталоге
def checkfile(dir, res):
    errors= []
    for x in res:
        file_src = os.path.join(modedir, x)
        if not os.path.isfile(file_src):
            errors.append('Error! File not found: ' + file_src)
    return errors
# Копирование файлов (папка от куда копируется, куда копируется, файлы)
def copymap(indir, outdir, listfile, iferrors=''):
    print('Start copy to dir: ' + outdir)
    # Проверяем копируемые файлы
    showerrors(checkfile(indir, listfile), iferrors)
    # Создаем папки /
    if os.path.exists(outdir):
        shutil.rmtree(outdir)
    os.makedirs(os.path.join(outdir, "maps"))
    # Копируем файлы по списку
    for i in listfile:
        # Файл, который копируется
        file_src = os.path.join(indir, i)
        # Файл, куда копируется
        file_dst = os.path.join(outdir, i)
        # Создание папки, если третуется
        filedir_dst = os.path.dirname(file_dst)
        if not os.path.exists(filedir_dst):
            os.makedirs(filedir_dst)
        # Если исходный файл есть, копируем
        if os.path.isfile(file_src):
            shutil.copyfile(file_src, file_dst)
    # Проверяем скопированные файлы
    print('Test file on dir: ' + outdir)
    showerrors(checkfile(outdir, listfile))
 
# Вывод ошибок и обнуление лога
def showerrors(x, warn=0):
    if x:
        for i in x:
            print(i)
        print("Completed with", len(x), "errors")
        if warn == 2:
            print("Can't continue, press enter to exit")
            input()
            sys.exit()
        if warn == 1:
            print("Press Enter to continue")
            input()
    else:
        print("Completed successfully")

